import React from 'react'
import { useEffect } from 'react';
import { useState } from 'react';
import { Fragment } from 'react'
import { ApiGetCall } from '../src/Connector';
import { Modal } from 'react-bootstrap';
function Testing() {

    const [GridData, setGridData] = useState([]);
    const [addpartsPopup, setAddpartsPopup] = useState(false);
    const [FlagForAddUpdate, setFlagForAddUpdate] = useState(false);
    const [FormData, setFormData] = useState({
        name: '',
        email: '',
        contact: '',
        city: '',
        age: ''
    });
    useEffect(() => {
        GetPartData(1, null)
        console.log(FormData)
    }, []);
    function GetPartData(flag, SearchString) {
        if (SearchString == "" || SearchString == undefined) {
            SearchString = null;
        }
        ApiGetCall("/api/displayDeetails").then((result) => {
            if (result == undefined || result == "") {
                alert("Something went wrong");
            } else {
                const responseRs = JSON.parse(result);
                console.log(responseRs)
                // if (responseRs.msg.length != 0) {
                //     setGridData(responseRs.msg);
                // } else {
                //     setGridData([])
                // }
            }
        });
    }
    function SaveUser() {
        setFormData(FormData)
        console.log(FormData)
    }
    function EditUser() {

    }
    return (
        <Fragment>
            <div className="d-flex justify-content-between pe-0 align-items-center">
                <div >
                    <h1 className="PageHeading">Manage Parts</h1>
                </div>
                <div className=" text-center d-flex justify-content-end align-items-end"
                    onClick={(e) => { setAddpartsPopup(true); setFlagForAddUpdate(1) }}>
                    <label className="BorderBtn text-center">
                        Add Parts
                        <img src="/images/AddInventory.svg" className="img-fluid ps-2" />
                    </label>
                </div>
            </div>


            <div className="GridBox mt-2 p-3">
                <div className="col-12 ">
                    <div className='col-12 greyBox mt-3 data-table-container'>
                        <table className="table data-table mb-0">
                            <thead className='GridHeader'>
                                <tr>
                                    <th scope="col" className='cursor-pointer fw-600' >Name</th>
                                    <th scope="col" className='cursor-pointer fw-600' >Email</th>
                                    <th scope="col" className='cursor-pointer fw-600'>Contact</th>
                                    <th scope="col" className='cursor-pointer fw-600'>City</th>
                                    <th scope="col" className='cursor-pointer fw-600'>Age</th>
                                    <th scope="col" className='cursor-pointer fw-600'>Action</th>
                                </tr>
                            </thead>
                            <tbody>
                                {GridData.length != 0 ?
                                    <>
                                        {GridData.map((item, i) => {
                                            var returData =
                                                <tr key={i} className={`OddEvenClass tableBorderHide `} style={{ height: '30px' }}>
                                                    <td className='py-12'>{item.data.Title}</td>
                                                    <td className='py-12'>${item.data.Variant_Price}</td>
                                                    <td className='py-12'>{item.data.Quantity}</td>
                                                    <td className='py-12'>${item.data.Variant_Price}</td>
                                                    <td className='py-12'>{item.data.Quantity}</td>
                                                    <td className='py-12'>
                                                        <img src="/images/EditIconNew.svg" title="Edit" className="img-fluid pe-2 cursor-pointer partsgetID"
                                                            onClick={(e) => { setAddpartsPopup(true); setFlagForAddUpdate(2) }}
                                                        />
                                                        <img src="/images/DeleteIcon.svg" title="Delete" className="img-fluid cursor-pointer" />
                                                    </td>
                                                </tr>
                                            return returData;
                                        })}
                                    </>
                                    :
                                    <tr> <td colSpan={8} className="p-3 text-center"> No Record Found </td></tr>
                                }
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>



            <Modal show={addpartsPopup} size="l">
                <div className="pt-3 px-2">
                    <div className="d-flex justify-content-between pe-0">
                        <div>
                            {FlagForAddUpdate == 1 ?
                                <h5 className="fw-600">Add User</h5>
                                :
                                <h5 className="fw-600">Edit User</h5>
                            }
                        </div>
                        <div className=" mb-2  text-center d-flex justify-content-end align-items-end">
                            <img src="/images/CanclePartsIson.svg" className="img-fluid ps-2" onClick={(e) => { setAddpartsPopup(false); }} />
                        </div>
                    </div>

                    <img src="/images/HorizontalLine.svg" className="img-fluid w-100 my-2 postclass" />

                    <div id="AddPartDiv" className='parent'>
                        <div className="row pt-2">
                            <div className="col-md-3 text-start">Name</div>
                            <div className="col-md-9 ps-0">
                                <input type="text" autoComplete="off" name="partName" className="form-control partNamee"
                                    value={FormData.name} onChange={(e) => { setFormData({ ...FormData, name: e.target.value }) }}
                                />
                            </div>
                        </div>
                        <div className="row pt-2">
                            <div className="col-md-3 text-start">Email</div>
                            <div className="col-md-9 ps-0">
                                <input type="text" autoComplete="off" name="partName" className="form-control partNamee"
                                    value={FormData.email} onChange={(e) => { setFormData({ ...FormData, email: e.target.value }) }}
                                />
                            </div>
                        </div>
                        <div className="row pt-2">
                            <div className="col-md-3 text-start">Contact</div>
                            <div className="col-md-9 ps-0">
                                <input type="text" autoComplete="off" name="partName" className="form-control partNamee"
                                    value={FormData.contact} onChange={(e) => { setFormData({ ...FormData, contact: e.target.value }) }}
                                />
                            </div>
                        </div>
                        <div className="row pt-2">
                            <div className="col-md-3 text-start">City</div>
                            <div className="col-md-9 ps-0">
                                <input type="text" autoComplete="off" name="partName" className="form-control partNamee"
                                    value={FormData.city} onChange={(e) => { setFormData({ ...FormData, city: e.target.value }) }}
                                />
                            </div>
                        </div>
                        <div className="row pt-2">
                            <div className="col-md-3 text-start">Age</div>
                            <div className="col-md-9 ps-0">
                                <input type="text" autoComplete="off" name="partName" className="form-control partNamee"
                                    value={FormData.age} onChange={(e) => { setFormData({ ...FormData, age: e.target.value }) }}
                                />
                            </div>
                        </div>
                    </div>
                    <div className="col-12 text-center py-4">
                        {FlagForAddUpdate == 1 ?
                            <button className="SaveBtn" onClick={(e) => SaveUser(e)}> Add User </button>
                            :
                            <button className="SaveBtn" onClick={(e) => EditUser(e)}> Update User </button>
                        }
                    </div>
                </div>
            </Modal>
        </Fragment>
    )
}

export default Testing
